problem:
There are two different isosceles triangles whose side lengths are integers and whose areas are $120.$ One of these two triangles, $\triangle XYZ,$ is shown. Determine the perimeter of the second triangle.

[asy]
draw((0,0)--(30,0)--(15,-8)--cycle,black+linewidth(1));
label("$X$",(0,0),W);
label("$Y$",(15,-8),S);
label("$Z$",(30,0),E);
label("30",(0,0)--(30,0),N);
label("17",(0,0)--(15,-8),SW);
label("17",(15,-8)--(30,0),SE);
[/asy]

solution:
Since $XY=YZ,$ then $\triangle XYZ$ is isosceles. Draw altitude $YW$ from $Y$ to $W$ on $XZ.$ Altitude $YW$ bisects the base $XZ$ so that $$XW=WZ=\frac{30}{2}=15,$$as shown.

[asy]
draw((0,0)--(30,0)--(15,-8)--cycle,black+linewidth(1));
draw((15,0)--(15,-8),black+linewidth(1)+dashed);
draw((15,0)--(15,-1)--(14,-1)--(14,0)--cycle,black+linewidth(1));
label("$X$",(0,0),W);
label("$Y$",(15,-8),S);
label("$Z$",(30,0),E);
label("$W$",(15,0),N);
label("17",(0,0)--(15,-8),SW);
label("17",(15,-8)--(30,0),SE);
label("15",(0,0)--(15,0),N);
label("15",(15,0)--(30,0),N);
[/asy]

Since $\angle YWX=90^{\circ},$ $\triangle YWX$ is right angled. By the Pythagorean Theorem, $17^2=YW^2+15^2$ or $YW^2=17^2-15^2$ or $YW^2=289-225=64,$ and so $YW=\sqrt{64}=8,$ since $YW>0.$

We rotate $\triangle XWY$ clockwise $90^{\circ}$ about $W$ and similarly rotate $\triangle ZWY$ counter-clockwise $90^{\circ}$ about $W$ to obtain a new isosceles triangle with the same area. The new triangle formed has two equal sides of length $17$ (since $XY$ and $ZY$ form these sides) and a third side having length twice that of $YW$ or $2\times8=16$ (since the new base consists of two copies of $YW$).

Therefore, the desired perimeter is $17+17+16= \boxed{50}.$

