&\quad + \frac{c^4}{(c - a)(c - b)(c - d)(c - e)} + \frac{d^4}{(d - a)(d - b)(d - c)(d - e)} \\
&\quad + \frac{e^4}{(e - a)(e - b)(e - c)(e - d)}.
\end{align*}

solution:
For $r = \cos 2 \theta \sec \theta,$
\[x = r \cos \theta = \cos 2 \theta\]and
\[y = r \sin \theta = \frac{\cos 2 \theta \sin \theta}{\cos \theta}.\][asy]
unitsize(1.5 cm);

real r, t, x, y;

t = -0.4*pi;
r = cos(2*t)/cos(t);
x = r*cos(t);
y = r*sin(t);
path foo = (x,y);

for (t = -0.4*pi; t <= 0.4*pi; t = t + 0.01) {
  r = cos(2*t)/cos(t);
  x = r*cos(t);
  y = r*sin(t);
  foo = foo--(x,y);
}

draw(foo,red);
draw((-1,-2.5)--(-1,2.5),blue + dashed);
draw((-1.5,0)--(1.5,0));
draw((0,-2.5)--(0,2.5));
[/asy]

As $\theta$ approaches $\frac{\pi}{2}$ from below, $x = \cos 2 \theta$ approaches $-1$ and $y = \frac{\cos 2 \theta \sin \theta}{\cos \theta}$ approaches $-\infty.$  Thus, the equation of the asymptote is $\boxed{x = -1}.$

problem:
The grid below contains the $16$ points whose $x$- and $y$-coordinates are in the set $\{0,1,2,3\}$: [asy]
size(2.5cm);
for(int i=0; i<4; i+=1) { for(int j=0; j<4; j+=1) { dot((i,j)); }; };
[/asy] A square with all four of its vertices among these $16$ points has area $A$. What is the sum of all possible values of $A$?

solution:
To form a square with its vertices on the grid, we can start with a $1\times 1$, $2\times 2$, or $3\times 3$ square, then (optionally) cut off four congruent right triangles whose legs add up to the side length of the square we started with. These are all possible ways we can do it (up to congruence): [asy]
size(7cm);
path a=(1,1)--(2,1)--(2,2)--(1,2)--cycle;
path b=(5,1)--(6,0)--(7,1)--(6,2)--cycle;
path c=(10,0)--(12,0)--(12,2)--(10,2)--cycle;
path d=(15,1)--(17,0)--(18,2)--(16,3)--cycle;
path e=(20,0)--(23,0)--(23,3)--(20,3)--cycle;
fill(a, gray); draw(a);
draw((5,0)--(7,0)--(7,2)--(5,2)--(5,0),dashed);
fill(b, gray); draw(b);
fill(c, gray); draw(c);
draw((15,0)--(18,0)--(18,3)--(15,3)--(15,0),dashed);
fill(d, gray); draw(d);
fill(e, gray); draw(e);
for(int i=0; i<4; i+=1) { for(int j=0; j<4; j+=1) { dot((i,j)); dot((i+5,j)); dot((i+10,j)); dot((i+15,j)); dot((i+20,j)); }; };
[/asy] The areas are $1$, $2$, $4$, $5$, and $9$. (In the case of the second and fourth squares, we can compute these areas by subtracting the areas of the right triangles from the area of the squares indicated by the dashed lines. Or, we can use the Pythagorean theorem to find the side length of each square, then square this to get the area.)

The sum of all possible areas is $1+2+4+5+9=\boxed{21}$.

