solution:
Let $x$ and $y$ be the width and length of one of the five rectangles, respectively.

[asy]
unitsize(0.6 cm);

draw((0,0)--(6,0)--(6,5)--(0,5)--cycle);
draw((0,2)--(6,2));
draw((3,0)--(3,2));
draw((2,2)--(2,5));
draw((4,2)--(4,5));

label("$x$", (1,5), N);
label("$x$", (3,5), N);
label("$x$", (5,5), N);
label("$y$", (6,7/2), E);
label("$x$", (6,1), E);
