\frac{ZY}{ZF} &= \frac{x}{z}, \\
\frac{AD}{AF} &= \frac{a}{c}, \\
\frac{AD}{ZF} &= \frac{a}{b}, \\
\frac{AY}{ZF} &= \frac{x}{z}, \\
\frac{YZ}{AF} &= 1, \\
