\[0 = \frac{x^2 - z^2}{z^2} + c.\]By the Factor Theorem, $(x - z)(x + z) = -z^2 c,$ so
\[c = \frac{x - z}{z}.\]Since $\frac{z}{a} + \frac{z}{b} = 1,$
