\[c^2 = \frac{x^2 - 2xz + z^2}{z^2},\]so
\[1 + ac = \frac{x^2 + 2xz + z^2}{z^2}.\]Then
\[0 = z^2 + (a - 1) zc^2 + c^2 - (a + 1) c = (z + c)(z + (a - 1)c).\]We cannot have $z + c = 0,$ so $z + (a - 1)c = 0.$  Then $a = 1 - \frac{z}{c} = \left( \frac{x + z}{c} \right) - 1,$ so
