Drop perpendiculars from $Q$, $R$ and $S$ to $D$, $E$ and $F$ respectively on $BC$.


[asy]
size(250);
pair P, Q, R, S, B, C, D, E, F, Y;
P=(4,2.236);
Q=(2.414,1);
R=(4,.618);
S=(5.586,1);
B=(0,0);
C=(8,0);
D=(2.414,0);
E=(4,0);
F=(5.586,0);
Y=(4,1);
draw(circle(P,1));
draw(circle(Q,1));
draw(circle(S,1));
draw(circle(R,.618));
draw(B--C);
draw(Q--D);
draw(P--E);
draw(F--S);
draw(Q--S);
