Since the circles with centers $Q$, $R$ and $S$ are tangent to $BC$, then $D$, $E$ and $F$ are the points of tangency of these circles to $BC$. Thus, $QD=SF=1$ and $RE=r$.

Join $QR$, $RS$, $PS$, $PQ$, and $PR$. Since we are connecting centers of tangent circles, $PQ=PS=2$ and $QR=RS=PR=1+r$.

Join $QS$. By symmetry, $PRE$ is a straight line (that is, $PE$ passes through $R$). Since $QS$ is parallel to $BC$, $QS$ is perpendicular to $PR$, meeting at $Y$.

Since $QD=1$, $YE=1$.  Since $RE=r$, $YR=1-r$. Since $QR=1+r$, $YR=1-r$ and $\triangle QYR$ is right-angled at $Y$, then by the Pythagorean Theorem,
\begin{align*}
QY^2 &= QR^2 - YR^2\\
&= (1+r)^2 - (1-r)^2 \\
&= (1+2r+r^2)-(1-2r+r^2) \\
&= 4r.
\end{align*}Since $PR=1+r$ and $YR=1-r$, then $PY = PR-YR=2r$. Since $\triangle PYQ$ is right-angled at $Y$,
\begin{align*}
PY^2 + YQ^2 & = PQ^2 \\
(2r)^2 + 4r & = 2^2 \\
4r^2 + 4r & =4 \\
r^2 + r - 1 & = 0.
\end{align*}By the quadratic formula, $r = \dfrac{-1\pm \sqrt{1^2-4(1)(-1)}}{2} = \dfrac{-1\pm\sqrt{5}}{2}$.
Since $r>0$, then $r = \dfrac{-1+\sqrt{5}}{2}$ (which is the reciprocal of the famous ``golden ratio"). Thus, $a+b+c=-1+5+2=\boxed{6}$.

By Pythagoras, the lengths $x,$ $\sqrt{16 - x^2},$ and 4 are the sides of a right triangle.  Similarly, $y,$ $\sqrt{25 -  y^2},$ and 5 are the sides of a right triangle, and $z,$ $\sqrt{36 - z^2},$ and 6 are the sides of a right triangle.  Stack these right triangles, as shown below.  Then $AE = x + y + z = 9$ and
\[DE = \sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2}.\][asy]
unitsize(0.4 cm);

pair A, B, C, D, E, P, Q, R, trans;

A = (0,0);
B = 4*dir(40);
C = B + 5*dir(60);
D = C + 6*dir(30);
E = (D.x,0);
P = (B.x,0);
Q = (C.x,B.y);
R = (D.x,C.y);
trans = (14,0);

draw(A--B--P--cycle);
draw(B--C--Q--cycle);
draw(C--D--R--cycle);
draw(P--E--R,dashed);

label("$x$", (A + P)/2, S, red);
label("$\sqrt{16 - x^2}$", (B + P)/2, dir(0), red);
label("$4$", (A + B)/2, NW, red);
label("$y$", (B + Q)/2, S, red);
label("$\sqrt{25 - y^2}$", (C + Q)/2, dir(0), red);
label("$5$", (B + C)/2, NW, red);
label("$z$", (C + R)/2, S, red);
label("$\sqrt{36 - z^2}$", (D + R)/2, dir(0), red);
label("$6$", (C + D)/2, NW, red);
label("$A$", A, SW);
label("$B$", B, NW);
label("$C$", C, NW);
label("$D$", D, NE);
label("$E$", E, SE);

draw(shift(trans)*(A--B--C--D--E--cycle));
draw(shift(trans)*(A--D),dashed);

label("$A$", A + trans, SW);
label("$B$", B + trans, SE);
label("$C$", C + trans, NW);
label("$D$", D + trans, NE);
label("$E$", E + trans, SE);
label("$9$", (A + E)/2 + trans, S, red);
label("$\sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2}$", (D + E)/2 + trans, dir(0), red);
[/asy]

By the Triangle Inequality,
\[AD \le AB + BC + CD = 4 + 5 + 6 = 15.\]By Pythagoras on right triangle $ADE,$
\[9^2 + (\sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2})^2 = AD^2 \le 15^2,\]so $(\sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2})^2 \le 15^2 - 9^2 = 144.$  Hence,
\[\sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2} \le 12.\]Equality occurs when $x = \frac{12}{5},$ $y = 3,$ and $z = \frac{18}{5}.$  (Note that this corresponds to the case where $A,$ $B,$ $C,$ and $D$ are collinear.)  Thus, the maximum value we seek is $\boxed{12}.$

gpt-4_answer:
By Cauchy-Schwarz,
\[(16 - x^2)(1^2) + (25 - y^2)(1^2) + (36 - z^2)(1^2) \ge (\sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2})^2.\]Hence,
\[\sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2} \le \sqrt{77 - (x^2 + y^2 + z^2)},\]so
\[\left( \sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2} \right)^2 \le 77 - r^2,\]where $r^2 = x^2 + y^2 + z^2.$

Since $\sqrt{16 - x^2},$ $\sqrt{25 - y^2},$ $\sqrt{36 - z^2} \ge 0,$ there exist right triangles with legs $x,$ $y,$ $z,$ and hypotenuse $\sqrt{16 - x^2},$ $\sqrt{25 - y^2},$ $\sqrt{36 - z^2},$ respectively.  Then the maximum value occurs when these right triangles are part of a right triangle with legs $x + y + z$ and $sqrt{r^2}.$  We can say that they form a triangle, because $x,y,z\gt0$, so the triangles won't degenerate into lines.

[asy]
unitsize(0.4 cm);

draw((4.661,0)--(0,3.339)--(-4.661,0));
draw((0,0)--(0,3.339));
draw((0,0)--(4.661,0));
draw((-4.661,0)--((4.661*x)/9,0));
draw((-4.661*x/9,0)--((4.661*x)/9,0));

draw((-4.661,0)--(-4.661*x/9,0));
draw((-4.661*x/9,0)--(-4.661*x^2/81,0));

label("$x$", (-4.661*x/18, 0), S);
label("$y$", (-8.219*y/18, 0), S);
label("$z$", (4.661*x/18, 0), S);

label("$\sqrt{36 - z^2}$", (4.661/2, 0), S);
label("$\sqrt{25 - y^2}$", (-4.661/18, 0), S);
label("$\sqrt{16 - x^2}$", (-8.219*y/18 - 4.661*(x^2/81)/2, 0), S);
label("$\sqrt{r^2}$", (0, 1.6695), W);

label("$9$", (2.3295, 0), S);

draw((9,0)--(8,0)--(8,1));
[/asy]
